function expandDropdown(e) {
	const _self = document.getElementById(e);
	const classArray = _self.className.split(" ");
	var wasshrunk = false;
	classArray.forEach(element => {
		if(element=="shrunk") {
			wasshrunk=true;
		}
	});
	if(wasshrunk) {
		_self.classList.remove('shrunk');
	}
	else {
		_self.classList.add('shrunk');
	}
}


